INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 2, 5118061, 7, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "青空の下で謁見", "ペコリーヌとの出会い", 1, 2834, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 2, 5118062, 7, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "未来の騎空団\nマスコット？", "マホとの出会い", 1, 2835, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 2, 5118063, 7, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "お嬢さまからの\n緊急依頼", "アキノとの出会い", 1, 2837, 0, 10118, "ランドソル市街地", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 2, 5118064, 18, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "黄金色の悩みごと", "ジュンとの出会い", 1, 4108402, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 2, 5118065, 18, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "白熱！　格闘大会！", "カオリとの出会い", 1, 4107402, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 1, 2, 5118066, 16, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "祭り太鼓はオーエドの華", "ニノンとの出会い", 1, 9000227, 0, 10118, "オーエド町", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 3, 5118067, 19, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "人気者は遅れて\nやってくる", "スズナとの出会い", 1, 2101181, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 3, 5118068, 18, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "巫女・ミーツ・魔法少女", "ナナカとの出会い", 1, 4109402, 0, 10118, "ランドソル市街地", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 3, 5118069, 18, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 1, 4305402, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 3, 5118070, 18, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "この出会いにカンパイ！", "ユカリとの出会い", 1, 4101402, 0, 10118, "ランドソル市街地", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 0, 3, 5118071, 18, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "陰陽アンサンブル", "アオイとの出会い", 1, 4106402, 0, 10118, "ランドソル市街地", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (8, 1, 3, 5118072, 7, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "運試し十番勝負！", "シノブとの出会い", 1, 2836, 0, 10118, "フリーマーケット会場", 40);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, 0, 1, 5118600, 0, 0, 0, "彼女たちの新たな日常", "オープニング", 0, 0, 10145115, 10118, 0, 0);
